SQL Query:
SELECT p.Manufacturer
FROM compatibility c JOIN probes p ON c.Probe_ID = p.Probe_ID
WHERE p.Probe_Model = 'C4-2';

SELECT Manufacturer
FROM probes
WHERE Probe_Model = 'C4-2' AND (Manufacturer = 'ATL' OR Manufacturer = 'G.E.');

SELECT CASE WHEN EXISTS (SELECT 1 FROM compatibility c JOIN systems s ON c.System_ID = s.System_ID WHERE s.System_Name = 'HDI 3000' AND c.Probe_ID = p.Probe_ID) THEN 'Yes' ELSE 'No' END AS WorksWith 
FROM probes p 
WHERE p.Manufacturer = ' ATL' AND p.Probe_Model = 'C7-4';

SELECT CASE WHEN EXISTS (SELECT 1 FROM compatibility c JOIN systems s ON c.System_ID = s.System_ID WHERE s.System_Name = 'HDI 4000' AND c.Probe_ID = p.Probe_ID) THEN 'Yes' ELSE 'No' END AS WorksWith 
FROM probes p 
WHERE p.Manufacturer = 'ATL' AND p.Probe_Model = 'C7-4';

SELECT CASE WHEN EXISTS (SELECT 1 FROM compatibility c JOIN systems s ON c.System_ID = s.System_ID WHERE s.System_Name = 'S1000' AND c.Probe_ID = p.Probe_ID) THEN 'Yes' ELSE 'No' END AS WorksWith 
FROM probes p 
WHERE Manufacturer = 'ATL' AND Probe_Model = 'C9-5ICT';

SELECT * FROM probes p 
JOIN compatibility c ON p.Probe_ID = c.Probe_ID 
WHERE p.Manufacturer = 'ATL' AND p.Probe_Model = 'CL 10-5' LIMIT 5;

SELECT CASE WHEN EXISTS (SELECT 1 FROM compatibility c JOIN systems s ON c.System_ID = s.System_ID WHERE s.System_Name = 'HDI 5000' AND c.Probe_ID = p.Probe_ID) THEN 'Yes' ELSE 'No' END AS WorksWith 
FROM probes p 
WHERE p.Probe_Model = 'ATL CT8-4';

SELECT p.Connection_Type, p.Array_Type, p.Frequency_Range
FROM probes p
WHERE p.Manufacturer = 'ATL' AND p.Probe_Model = 'MPT 7-4';

SELECT CASE WHEN EXISTS (SELECT 1 FROM compatibility c JOIN systems s ON c.System_ID = s.System_ID WHERE s.System_Name = 'HDI 5000' AND c.Probe_ID = p.Probe_ID) THEN 'Yes' ELSE 'No' END AS WorksWith 
FROM probes p 
WHERE p.Manufacturer = 'ATL' AND p.Probe_Model = 'P3-2';

SELECT CASE WHEN EXISTS (SELECT 1 FROM compatibility c JOIN systems s ON c.System_ID = s.System_ID WHERE s.System_Name = 'HDI 4000' AND c.Probe_ID = p.Probe_ID) THEN 'Yes' ELSE 'No' END AS WorksWith 
FROM probes p 
WHERE p.Manufacturer = 'ATL' AND p.Probe_Model = 'P3-2';

SELECT s.System_Name 
FROM compatibility c JOIN probes p ON c.Probe_ID = p.Probe_ID JOIN systems s ON c.System_ID = s.System_ID 
WHERE p.Manufacturer = 'ATL' AND p.Probe_Model = 'P4-2' LIMIT 5;

SELECT p.Manufacturer 
FROM probes p 
WHERE p.Probe_Model = 'P5-3';

SELECT s.System_Name
FROM compatibility c JOIN probes p ON c.Probe_ID = p.Probe_ID JOIN systems s ON c.System_ID = s.System_ID
WHERE p.Manufacturer = 'ATL' AND p.Probe_Model = 'P6-3' LIMIT 5;

SELECT CASE WHEN EXISTS (SELECT 1 FROM compatibility c JOIN systems s ON c.System_ID = s.System_ID WHERE s.System_Name = 'HDI 5000' AND c.Probe_ID = p.Probe_ID) THEN 'Yes' ELSE 'No' END AS WorksWith
FROM probes p 
WHERE p.Manufacturer = 'ATL' AND p.Probe_Model = 'P6-3';

SELECT p.Array_Type
FROM probes p
WHERE p.Manufacturer = 'G.E.' AND p.Probe_Model = '227s';

SELECT p.Array_Type
FROM probes p
WHERE p.Manufacturer = 'G.E.' AND p.Probe_Model = '348c' LIMIT 5;

SELECT p.Probe_Model, p.Manufacturer, CASE WHEN p.Stock > 0 THEN 'In Stock' ELSE 'Out of Stock' END AS StockStatus
FROM probes p
WHERE p.Manufacturer = 'G.E.' AND p.Probe_Model = '618c' LIMIT 5;

SELECT p.Probe_Model, p.Manufacturer
FROM probes p
WHERE p.Manufacturer = 'G.E.' AND p.Probe_Model = 'RAB2-5L';

SELECT p.Manufacturer, p.Probe_Model, CASE WHEN p.Stock > 0 THEN 'Yes' ELSE 'No' END AS AvailableForSale
FROM probes p
WHERE p.Manufacturer = 'G.E.' AND p.Probe_Model = 'RIC5-9D' LIMIT 5;

SELECT p.Array_Type, p.Connection_Type 
FROM probes p 
WHERE p.Manufacturer = 'Philips' AND p.Probe_Model = 'C5-1' LIMIT 5;

SELECT p.Probe_Model, p.Stock, c.System_ID, s.System_Name
FROM probes p JOIN compatibility c ON p.Probe_ID = c.Probe_ID JOIN systems s ON c.System_ID = s.System_ID
WHERE p.Array_Type = 'C5-1' AND c.System_ID IN (SELECT System_ID FROM systems WHERE System_Name = 'iE33') LIMIT 5;

SELECT p.Manufacturer
FROM probes p
WHERE p.Probe_Model = 'C8-4v';

SELECT Manufacturer 
FROM probes 
WHERE Probe_Model = 'C9-3v' AND Connection_Type = 'Cartridge';

SELECT p.Manufacturer, p.Probe_Model, p.Connection_Type, c.System_ID, s.System_Name
FROM probes p JOIN compatibility c ON p.Probe_ID = c.Probe_ID JOIN systems s ON c.System_ID = s.System_ID
WHERE p.Probe_Model = 'C9-3v' AND p.Connection_Type = 'Cartridge' AND s.System_Name = 'EPIQ';

SELECT CASE WHEN COUNT(*) > 0 THEN 'Yes' ELSE 'No' END AS WorksWith
FROM compatibility c JOIN systems s ON c.System_ID = s.System_ID JOIN probes p ON c.Probe_ID = p.Probe_ID
WHERE p.Manufacturer = 'Philips' AND p.Probe_Model = 'L12-3' AND p.Connection_Type = 'Cartridge' AND s.System_Name = 'iU22' LIMIT 5;

SELECT p.Array_Type 
FROM compatibility c JOIN probes p ON c.Probe_ID = p.Probe_ID 
WHERE p.Manufacturer = 'Philips' AND p.Probe_Model = 'S4-2' AND p.Connection_Type = 'Cartridge';

SELECT p.Probe_Model, p.Manufacturer 
FROM probes p JOIN compatibility c ON p.Probe_ID = c.Probe_ID 
WHERE c.System_ID IN (SELECT System_ID FROM systems WHERE System_Name = 'HDI 15') AND p.Array_Type = 'Linear' LIMIT 5;

SELECT p.Probe_Model, p.Manufacturer
FROM probes p JOIN compatibility c ON p.Probe_ID = c.Probe_ID JOIN systems s ON c.System_ID = s.System_ID
WHERE s.System_Name = 'Voluson E8' AND p.Array_Type = 'Linear' LIMIT 5;
